SET NOCOUNT ON
GO

USE master
GO
if exists (select * from sysdatabases where name='Northwind2019')
		drop database Northwind2019
go

DECLARE @device_directory NVARCHAR(520)
SELECT @device_directory = SUBSTRING(filename, 1, CHARINDEX(N'master.mdf', LOWER(filename)) - 1)
FROM master.dbo.sysaltfiles WHERE dbid = 1 AND fileid = 1

EXECUTE (N'CREATE DATABASE Northwind2019
  ON PRIMARY (NAME = N''Northwind2019'', FILENAME = N''' + @device_directory + N'Northwind2019.mdf'')
  LOG ON (NAME = N''Northwind2019_log'',  FILENAME = N''' + @device_directory + N'Northwind2019.ldf'')')
go

alter database Northwind2019 set recovery simple
GO

set quoted_identifier on
GO

/* Set DATEFORMAT so that the date strings are interpreted correctly regardless of
   the default DATEFORMAT on the server.
*/
SET DATEFORMAT mdy
GO
